import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import { fetchApi } from '../../utils/backendApi';

const DisplayMetrics = () => {
  const columns = ["Сумма всех заказов", "Статус", "Дата отправки", "Сумма документа", "Номер телефона", "Себестоимость"];
  

  const fetchOrdersUrl = "http://localhost:4000/metrics";

  const [metrics, setMetrics] = useState([]);


  useEffect(() => {
    const fetchData = async () => {
      const fetchedOrders = await fetchApi(fetchOrdersUrl, 'GET');
      setMetrics(fetchedOrders.map(metric => ({
        ...metric
      })));
    };

    fetchData();
  }, []);

  useEffect(()=>{
    console.log(metrics);
  }, [metrics]);

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            {columns.map((column, index) => (
              <TableCell key={index}>{column}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default DisplayMetrics;
